import "./GetSongBpmSearch.css"

const GetSongBpmSearch = () => {

    const exampleResult = {
        title: "Example Song",
        artist: "Example Artist",
        tempo: 120
    }

    const results = (
        <ul>
            <li className="text" id="SongText">{exampleResult.title} - {exampleResult.artist}</li><li className="text" id="BpmText">BPM: {exampleResult.tempo}</li>
        </ul>
    )

    return (
        <div>
            <div className="SearchBar">
                <h2></h2>
                <input id="SearchBar" className="text" placeholder="Search getsongbpm.com..." />
                <button id="SearchButton" ></button>
            </div>
            <div id="SearchResults">
                {results}
            </div>
        </div>
    )
}

export default GetSongBpmSearch;
